export default {
  props: [],
  data: function data() {
    return {
      dialog_edit_showing: false,
      item: {},
      form: {}
    };
  },
  mounted: function mounted() {
    this.ReLoad();
  },
  methods: {
    edit: function edit() {
      this.item = this.from;
      this.dialog_edit_showing = true;
    },
    ReLoad: function ReLoad() {
      var _this = this;

      this.axios.get('/guanqu/web/users/online-user').then(function (res) {
        _this.form = res.data; // this.tableData = res.data.list;
        // this.list_input.total = res.data.totalCount;
      });
    },
    del: function del() {
      var _this2 = this;

      this.$confirm("您确定删除【XXX】菜单吗?", "", {
        confirmButtonText: "确定",
        cancelButtonText: "取消",
        type: "warning"
      }).then(function () {
        _this2.$message({
          type: "success",
          message: "删除菜单成功!"
        });
      }).catch(function () {
        _this2.$message({
          type: "error",
          message: "网络错误！删除菜单失败！"
        });
      });
    },
    openEdit: function openEdit() {
      this.$emit("showEdit");
    }
  },
  computed: {},
  components: {
    EDIT: EDIT
  }
};
